            void createLocations()
            {
                if (dbContext.Locations.Any())
                    return;

                var defaultStore = dbContext.Stores.First(s => s.IsDefault);
                if (defaultStore == null)
                    return;
                
                for (int aisle = 1; aisle < 51; aisle++)
                {
                    for (int shelf = 1; shelf < 3; shelf++)
                    {
                        for (int bin = 1; bin < 6; bin++)
                        {
                            Location newLocation = new Location()
                            {
                                Name = $"A{padLeft(aisle)} S{padLeft(shelf)} B{padLeft(bin)}",
                                Barcode = $"A{padLeft(aisle)}S{padLeft(shelf)}B{padLeft(bin)}",
                                Description = $"Aisle {padLeft(aisle)} Shelf {padLeft(shelf)} Bin {padLeft(bin)}",
                                FlaggedForAudit = false,
                                FlaggedForCycleCount = false,
                                StoreId = defaultStore.StoreId
                            };
                            dbContext.Locations.Add(newLocation);
                        }
                    }
                }

                dbContext.SaveChanges();

                return;
            }
        }

        private static string padLeft(int num)
        {
            return (num < 10) ? $"0{num}" : num.ToString();
        }
